A: In most cases, I prefer to use a prepared statement.  It is usually way more secure that just using an un-sanitized variable in the query.
For example, here is a basic example:
$sql = "INSERT INTO members(first_name, last_name, email, password, username) 
VALUES (?, ?, ?, ?, ?)";

$stmt = mysql_prepare($sql, $vals);

$first_name = $_POST['first_name'];
$last_name = $_POST['last_name'];
$email   = $_POST['email'];
$password = $_POST['password'];
$username = $_POST['username'];

$stmt->bind_param('ssssss', $first_name, $last_name, $email, $password, $username);

if($stmt->execute()){
    echo "success";
}

There are a couple different things that need to be taken into consideration here.  First is that I have used the standard MySQL error handling, which will likely catch the error if it is thrown.
Second, the mysqli_stmt is a bit more secure against SQL Injections.  This method uses the prepared statement, which is a bit more secure.  That said, this will not prevent SQL Injections, as it does not apply any checks on the values that are being sent to the server.

A: I would do this in an array and then use the array index as a variable in the query to send multiple variables to the database.
$sql= "INSERT INTO members
        (first_name, last_name, email, password, username)
        VALUES (?, ?, ?, ?, ?)";

    $stmt = mysql_prepare($sql, $vals);

    $first_name = $_POST['first_name'];
    $last_name = $_POST['last_name'];
    $email   = $_POST['email'];
    $password = $_POST['password'];
    $username = $_POST['username'];

    $stmt->bind_param('ssssss', $first_name, $last_name, $email, $password, $username);

    if(mysql_stmt_execute($stmt)){
        echo "success";
    }
